If the --json option is supplied, all relayer commands will output single-line JSON values instead of plain text. Log messages will be written to stderr, while the final result will be written to stdout, and everything will be formatted as JSON. This allows processing only the final output using jq . To process all the output using jq, one can redirect stderr to stdout with hermes --json COMMAND 2>&1 | jq. Example hermes --config /home/my_chain.toml --json create client --host-chain ibc-0 --reference-chain ibc-1 {"timestamp":"Apr 13 20:46:31.921","level":"INFO","fields":{"message":"Using default configuration from: '.hermes/config.toml'"},"target":"ibc_relayer_cli::commands"}
