Use the update client command to update an existing client with a new consensus state. Specific update and trusted heights can be specified. USAGE: hermes update client [OPTIONS] --host-chain <HOST_CHAIN_ID> --client <CLIENT_ID> DESCRIPTION: Update an IBC client OPTIONS: --height <REFERENCE_HEIGHT> The target height of the client update. Leave unspecified for latest height. --trusted-height <REFERENCE_TRUSTED_HEIGHT> The trusted height of the client update. Leave unspecified for latest height. REQUIRED: --client <CLIENT_ID> Identifier of the chain targeted by the client --host-chain <HOST_CHAIN_ID> Identifier of the chain that hosts the client Update client with latest header the client on ibc-0 with latest header of ibc-1: hermes update client --host-chain ibc-0 --client 07-tendermint-9 Success: UpdateClient( UpdateClient { common: Attributes { height: Height { revision: 0, height: 303 }, client_id: ClientId( "07-tendermint-1", ), client_type: Tendermint, consensus_height: Height { revision: 1, height: 293 }, }, header: Some( Tendermint( Header {...}, ), ), },
) The client with identifier 07-tendermint-1 has been updated with the consensus state at height 1-293. Update a client to a specific target height hermes update client --host-chain ibc-0 --client 07-tendermint-1 --height 320 --trusted-height 293 Success: UpdateClient( UpdateClient { common: Attributes { height: Height { revision: 0, height: 555 }, client_id: ClientId( "07-tendermint-1", ), client_type: Tendermint, consensus_height: Height { revision: 1, height: 320 }, }, header: Some( Tendermint( Header {...}, ), ), },
) The client with identifier 07-tendermint-1 has been updated with the consensus state at height 1-320, as specified.
